import React from "react";

const useRobohash = () => {
    const[myRoboImg,setMyRoboImg]=
  fetch("https://robohash.p.rapidapi.com/index.php?text=mashape", {
    method: "GET",
    headers: {
      "x-rapidapi-host": "robohash.p.rapidapi.com",
      "x-rapidapi-key": "undefined",
    },
  })
    .then((response) => {
        console.log(response);
        
    })
    .catch((err) => {
      console.error(err);
    });
  return response;
};
export default useRobohash;
